import { StyleSheet, Text, View, Button } from "react-native";

export default function Market({ navigation }) {
  return (
    <View>
      <Text style={styles.container}>This is a test</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
